  render();

  return (
    <div
      style={{
        position: 'absolute',
        backgroundColor: 'green',
        width: '100%',
        he,
      }}
    >
      <img
        src={mapleLeaf}
        className="leafAnimation"
        style={{marginTop: 190, marginLeft: 300}}
      />
      <img
        src={mapleLeaf}
        className="leaf2Animation"
        style={{marginTop: 100}}
      />
    </div>
  );
};
export default LeafsComponents;
